//https://leetcode.com/problems/find-the-longest-equal-subarray
class Solution {
public:
    int longestEqualSubarray(vector<int>& nums, int k) {
        unordered_map<int,int> m;
        int left = 0;
        int right = 0;
        int max_res = 0;
        int max_rep = 0;
        while(left <= right && right < nums.size()){
            m[nums[right]]++;
            max_rep = max(max_rep, m[nums[right]]);
            right++;
            int window = right - left;
            while(window - max_rep > k){
                m[nums[left]]--;
                left++;
                window = right - left;
            }
            max_res = max(max_res, max_rep);
        }
        return max_res;
    }
};

